######### USING THE DATA TO ANSWER OUR QUESTION #########
-- Summing the number of names with 'Max' in them
SELECT SUM(FREQUENCY) AS NUMBER_OF_DOGS
FROM DOG_BABY_NAME_DB.DOG_NAME_SUMY			-- Dogs
WHERE DOG_NAME LIKE '%MAX%' 				-- Enter your name between the brackets
;
SELECT SUM(FREQUENCY) AS NUMBER_OF_BABIES
FROM DOG_BABY_NAME_DB.BABY_NAME_SUMY		-- Babies
WHERE BABY_NAME LIKE '%MAX%' 				-- Enter your name between the brackets
;


-- Summing the number of names that are exactly 'Max'
SELECT SUM(FREQUENCY) AS NUMBER_OF_DOGS
FROM DOG_BABY_NAME_DB.DOG_NAME_SUMY			-- Dogs
WHERE DOG_NAME = 'MAX' 						-- Enter your name between the brackets
;
SELECT SUM(FREQUENCY) AS NUMBER_OF_BABIES
FROM DOG_BABY_NAME_DB.BABY_NAME_SUMY		-- Babies
WHERE BABY_NAME = 'MAX' 					-- Enter your name between the brackets
;

-- Checking what the dog names were that contained "Max"
SELECT *
FROM DOG_BABY_NAME_DB.DOG_NAME_SUMY			-- Dogs
WHERE DOG_NAME LIKE '%MAX%'


-- But what about as a proportion of the dataset
SELECT YOUR_NAME_DOG
	 , TOTAL_DOG
     , 100*(1.00*SUB.YOUR_NAME_DOG)/(1.00*SUB.TOTAL_DOG) 						AS PERC_OF_DOG_NAMES
FROM (
		SELECT SUM(CASE WHEN DOG_NAME LIKE '%MAX%' THEN FREQUENCY ELSE 0 END)   AS YOUR_NAME_DOG
			 , SUM(FREQUENCY) 													AS TOTAL_DOG
		FROM DOG_BABY_NAME_DB.DOG_NAME_SUMY			
	 ) AS SUB
;

SELECT YOUR_NAME_BABY
	 , TOTAL_BABY
     , 100*(1.00*SUB.YOUR_NAME_BABY)/(1.00*SUB.TOTAL_BABY) 					    AS PERC_OF_BABY_NAMES
FROM (
		SELECT SUM(CASE WHEN BABY_NAME LIKE '%MAX%' THEN FREQUENCY ELSE 0 END)  AS YOUR_NAME_BABY
			 , SUM(FREQUENCY) 													AS TOTAL_BABY
		FROM DOG_BABY_NAME_DB.BABY_NAME_SUMY			
	 ) AS SUB
;


